import React from "react"

class Card extends React.Component {
    render() {
        return(
            <div class="container">
                <div class="row pt-5">
                    <div class="col-3"></div>
                    <div class="col-6">
                        <form>
                         <div class="form-group">
                             <label for="inputApiKey">Enter api-key</label>
                             <input type="apikey" class="form-control" id="inputApiKey1" aria-describedby="apiKey" placeholder="Enter api-key"></input>
                         </div>
                         <button type="submit" class="btn btn-primary">Submit</button>
                    </form>
                    </div>
                    <div class="col-3"></div>
                </div>
            </div>
        )
    }
}

export default Card;
